import React from "react";
import "bootstrap/dist/css/bootstrap.css";
import { Link } from "react-scroll";
import { Nav, Navbar, NavDropdown } from "react-bootstrap";
import icon from "../../Images/tech.png";
import "./header1.css";

const App = () => {
  return (
    <div className="header">
      <Navbar bg="dark" variant="dark" fixed="top" expand="sm">
        <div className="header__left">
          <Navbar.Brand style={{ padding: "0px", margin: "0px" }}>
            <h1 className="header__left__tech">
              {/* <img
                className="imagelogo"
                src={icon}
                alt=""
                width="30"
                height="30"
              /> */}
              Tech
              <span className="club">Club</span>
            </h1>
          </Navbar.Brand>
        </div>
        <div className="header__right__">
          <Navbar.Toggle className="toogle_bar" />
          <Navbar.Collapse className="justify-content-end">
            {/* <Nav> */}
            <Navbar.Text>
              <Link to="Home" smooth={true} duration={500}>
                {/* <Nav.Link href="#"> */}
                <h4 className="navbar">Home</h4>
                {/* </Nav.Link> */}
              </Link>
            </Navbar.Text>
            <Navbar.Text>
              <Link to="Mission" smooth={true} duration={500}>
                {/* <Nav.Link href="#"> */}
                <h4 className="navbar">Vission & Mission</h4>
                {/* </Nav.Link> */}
              </Link>
            </Navbar.Text>
            <Navbar.Text>
              <Link to="Work" smooth={true} duration={500}>
                {/* <Nav.Link href="#"> */}
                <h4 className="navbar">Work</h4>
                {/* </Nav.Link> */}
              </Link>
            </Navbar.Text>
            <Navbar.Text>
              <Link to="Event" smooth={true} duration={500}>
                {/* <Nav.Link href="#"> */}
                <h4 className="navbar">Events</h4>
                {/* </Nav.Link> */}
              </Link>
            </Navbar.Text>
            <Navbar.Text>
              <Link to="Contact" smooth={true} duration={500}>
                {/* <Nav.Link href="#"> */}
                <h4 className="navbar">Contact</h4>
                {/* </Nav.Link> */}
              </Link>
            </Navbar.Text>
            {/* </Nav> */}
          </Navbar.Collapse>
        </div>
      </Navbar>
    </div>
  );
};

export default Header1;
